import React from 'react';

const Cam = () => {
  return (
    <div>
      <h2>Webcam Feeds</h2>
      <div className="row">
        <div className="col-md-6">
          <h3>Camera 1</h3>
          <video src="http://localhost:5000/video_feed1" controls autoPlay></video>
        </div>
        <div className="col-md-6">
          <h3>Camera 2</h3>
          <video src="http://localhost:5000/video_feed2" controls autoPlay></video>
        </div>
      </div>
    </div>
  );
};

export default Cam;
